import './App.css';
import Home from './Home';
import { Route, Routes, BrowserRouter } from 'react-router-dom';


function App() {
  return (
    <BrowserRouter>
      <nav>
          <a href="/">Home</a> | 
      </nav>
      <Routes>
        <button></button>
        <Route path="/" element={<Home />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
